(function($){
 	$.fn.bgLoaded = function(custom) {

 		var self = this;

	// Default plugin settings
	var defaults = {
		afterLoaded : function(){
			this.addClass('bg-loaded');
		}
	};

		// Merge default and user settings
		var settings = $.extend({}, defaults, custom);

		// Loop through element
		self.each(function(){
			var $this = $(this),
				bgImgs = $this.css('background-image').split(', ');
			$this.data('loaded-count',0);

			$.each( bgImgs, function(key, value){
				var img = value.replace(/^url\(["']?/, '').replace(/["']?\)$/, '');
				$('<img/>').attr('src', img).load(function() {
					$(this).remove(); // prevent memory leaks
					$this.data('loaded-count',$this.data('loaded-count')+1);
					if ($this.data('loaded-count') >= bgImgs.length) {
						settings.afterLoaded.call($this);
					}
				});
			});

		});
	};
})(jQuery);
$(function(){
	var moduleUpload = {
		cacheDom: function(){
			this.$fileCase = $(".file-case");
			this.$body = $("body");
		},
		upload: function(e){
			var cnt = $(e.currentTarget).parents('.file-case').find('.msg')
			cnt.html('')

			var files = $(e.currentTarget).prop("files")
			var names = $.map(files, function (val) { return val.name; });
			if(names.length > 0){
				$.each(names, function (i, name) {
					cnt.prepend('<span data-num="'+ i +'">'+ name +'</span>') //c
				});
				$(e.currentTarget).trigger('blur')
			}else{
				cnt.text('Upload your project description or something (pdf, jpg, doc)')
			}
		},
		triggerInput: function(e){
			var fileCase = $(e.currentTarget).parents('.file-case')
			fileCase.find("input[type='file']").trigger('click')
		},
		events: function(){
			this.$fileCase.find(".btns").on('click', this.triggerInput.bind(this));
			this.$fileCase.find("input[type='file']").on('change', this.upload.bind(this));
		},
		init: function(){
			this.cacheDom()
			this.events()
			
		}
	}

	if($('.file-case').length > 0){
		moduleUpload.init();
	}
});
